  adder_8 adder_8_0(sum_temp[7:0], cout_temp, in1[7:0], in2[7:0], cin);
  adder_8 adder_8_1(sum_temp[15:8], cout_temp, in1[15:8], in2[15:8], cout_temp);

endmodule

